// /src/components/Navbar.tsx
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li><Link to="/movies-per-actor">Movies Per Actor</Link></li>
        <li><Link to="/actors-with-multiple-characters">Actors with Multiple Characters</Link></li>
        <li><Link to="/characters-with-multiple-actors">Characters with Multiple Actors</Link></li>
      </ul>
    </nav>
  );
};

export default Navbar;
